import './App.css';
import Image from "./components/Image"
import Sign from "./components/Sign";
function App() {

  let url='';
  function imageurl(data){
    console.log(data);
    url=data;
  }

  return (
    <div className="App">
       <Sign url={url}/>
       <Image imageurl={imageurl}/>
    </div>
  );
}

export default App;
